import React from "react";

const StockInfo = ({close, open, high, low, volume}) => {
    return ( 
        <div style = {{
            marginLeft: '1%'
        }}>
            <h3>Open: {open}</h3>
            <p>Close: {close}</p>
            <p>High: {high}</p>
            <p>Low: {low}</p>
            <p>Volume: {volume}</p>
        </div> 
    );
};

export default StockInfo;
